import React from 'react';
import './App.scss';
import Main from './components/main';
import { Link } from 'react-router-dom';
import {Navbar, Nav, Container, Row} from 'react-bootstrap';

function App() {
  return (
    <div>
    <h5 className="title"> Leaseplan + </h5>
      
    <Navbar  fixed="bottom" bg="light" variant="light" className="justify-content-center navbar">
    <Nav className="mr-auto">
    <Nav.Link> <Link to="/">Home</Link> </Nav.Link>
    <Nav.Link> <Link to="/agenda">Agenda</Link> </Nav.Link>
    <Nav.Link> <Link to="/notifications">Notification</Link> </Nav.Link>
    </Nav>
  </Navbar>
  <Main/>
    </div>
  );
}

export default App;
